import './List.css';
import ListItem from '../listItem/ListItem';


const List = ({task, selectTask,selectedItems}) => {

 

    const elem = task.map(i => <ListItem key={i.id} i={i} selectTask={selectTask} task={task}/>)


    return(
        
            <ul>
                {elem}
            </ul>
        
    )
}

export default List
